	(3193, 1, '::1', '2019-03-07 13:12:46', 'CUSTOM', '0', 'Ticket API:OpenTickets GET:Array\n(\n    [section] => opentickets\n    [user] => 1\n)\n', 'CUSTOM', 'CUSTOM', 'SELECT \r\n    *,\r\n    ( \r\n        SELECT\r\n        GROUP_CONCAT(tke_type, \' \' ,prd_model, \'<br>\')\r\n        FROM\r\n        ticket_events\r\n        JOIN unique_serials ON tke_unique_serial_ID = uqs_unique_serial_ID\r\n        JOIN products ON prd_product_ID = uqs_product_ID\r\n        WHERE\r\n        tke_ticket_ID = tck_ticket_ID\r\n    )as events_description,\r\n    (\r\n    SELECT\r\n        GROUP_CONCAT(\' \',prd_model)as value\r\n        FROM\r\n        ticket_products\r\n        JOIN products ON prd_product_ID = tkp_product_ID\r\n        WHERE\r\n        tkp_ticket_ID = tck_ticket_ID\r\n    )as products_description\r\n    FROM\r\n    tickets\r\n    JOIN customers ON cst_customer_ID = tck_customer_ID\r\n    JOIN codes ON cst_city_code_ID = cde_code_ID\r\n    WHERE\r\n    tck_status = \'Open\' AND (tck_assigned_user_ID = \'1\' OR tck_assigned_user_ID = -1)'),
	(3194, 1, '::1', '2019-03-07 13:27:18', 'CUSTOM', '0', 'Transaction API:none GET:Array\n(\n    [section] => customers\n    [term] =>  er\n)\n', 'CUSTOM', 'CUSTOM', 'SELECT \r\n              cst_customer_ID as value, \r\n              CONCAT(cst_name, \' \', cst_surname) as label,\r\n              cst_identity_card as identity_card,\r\n              cst_work_tel_1 as work_tel,\r\n              cst_mobile_1 as mobile\r\n               FROM customers WHERE \r\n              (\r\nCONCAT(cst_identity_card, \' \', cst_name, \' \', cst_surname) \r\n                LIKE \'% er%\'\r\nOR\r\nCONCAT(cst_work_tel_1, \' \', cst_work_tel_2, \' \', cst_fax, \' \', cst_mobile_1, \' \', cst_mobile_2 )\r\n	LIKE \'% er%\') \r\n	LIMIT 0,25'),
	(3195, 1, '::1', '2019-03-07 13:27:19', 'CUSTOM', '0', 'Transaction API:none GET:Array\n(\n    [section] => customers\n    [term] =>  erm\n)\n', 'CUSTOM', 'CUSTOM', 'SELECT \r\n              cst_customer_ID as value, \r\n              CONCAT(cst_name, \' \', cst_surname) as label,\r\n              cst_identity_card as identity_card,\r\n              cst_work_tel_1 as work_tel,\r\n              cst_mobile_1 as mobile\r\n               FROM customers WHERE \r\n              (\r\nCONCAT(cst_identity_card, \' \', cst_name, \' \', cst_surname) \r\n                LIKE \'% erm%\'\r\nOR\r\nCONCAT(cst_work_tel_1, \' \', cst_work_tel_2, \' \', cst_fax, \' \', cst_mobile_1, \' \', cst_mobile_2 )\r\n	LIKE \'% erm%\') \r\n	LIMIT 0,25'),
	(3196, 1, '::1', '2019-03-07 13:27:35', 'CUSTOM', '0', 'Unique Serials API:check_if_exists GET:Array\n(\n    [section] => check_if_exists\n    [term] => 12345555555\n    [excludeSerial] => 0\n)\n\nData:', 'CUSTOM', 'CUSTOM', 'SELECT\r\n            uqs_unique_serial as value,\r\n            uqs_product_ID as product_ID,\r\n            uqs_agreement_ID as agreement_ID,\r\n            uqs_status as status\r\n            FROM\r\n            unique_serials\r\n            WHERE\r\n            uqs_status = \'Active\'\r\n            AND uqs_unique_serial = \'12345555555\'\r\n            AND uqs_unique_serial_ID != 0'),
	(3197, 1, '::1', '2019-03-07 13:27:53', 'CUSTOM', '0', 'Products API:products_search_machines GET:Array\n(\n    [section] => products_search_machines\n    [term] => lp\n)\n', 'CUSTOM', 'CUSTOM', 'SELECT \r\n              prd_product_ID as value, \r\n              CONCAT(prd_model, \' \', prd_name) as label,\r\n              prd_current_stock as current_stock,\r\n              prd_description as description\r\n              FROM \r\n              products \r\n              JOIN manufacturers ON mnf_manufacturer_ID = prd_manufacturer_ID\r\n              WHERE \r\n              CONCAT(prd_model, prd_name) LIKE \'%lp%\'\r\n              AND prd_type = \'Machine\'\r\n	            \r\n	          LIMIT 0,25'),
